(function(jQuery){
     jQuery.fn.extend({  
         accordionOzy: function() {
            return this.each(function() {
            	var $ul = jQuery(this);
				if($ul.data('accordiated'))
					return false;
				jQuery.each($ul.find('ul, li>div'), function(){
					jQuery(this).data('accordiated', true);
					jQuery(this).hide();
				});
				jQuery.each($ul.find('a'), function(){
					if(jQuery(this).attr('href') === '#') {
						jQuery(this).click(function(e){
							activate(this);
							return void(0);
						});
					}else{ //if the item not linked to itself, 
						var $this = this;
						jQuery(this).find('i').click(function(e) {
							activate($this);
							e.preventDefault();
							return void(0);							
                        });
					}
				});				
				var active = (location.hash)?jQuery(this).find('a[href=' + location.hash + ']')[0]:'';
				if(active){
					activate(active, 'toggle');
					jQuery(active).parents().show();
				}				
				function activate(el,effect){
					jQuery(el).parent('li').toggleClass('active').siblings().removeClass('active');
					jQuery(el).find('i:first-child').toggleClass('active');
					jQuery(el).siblings('ul, div')[(effect || 'slideToggle')]((!effect)?'fast':null);
				}
				
            });
        } 
    }); 
})(jQuery);